import React, { useEffect } from "react";
import { useState } from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// core components
import Header from "components/Header/Header.js";
import Footer from "components/Footer/Footer.js";
import styles from "assets/jss/material-kit-react/views/landingPage.js";
import Button from "components/CustomButtons/Button.js";
// import HeaderLinks from "components/Header/HeaderLinks.js";
import Parallax from "components/Parallax/Parallax.js";
import Card from "components/Card/Card.js";

import _ from "lodash";



const dashboardRoutes = [];
const useStyles = makeStyles(styles);


export default function States(props) {
    const classes = useStyles();

  const { ...rest } = props;
  return (
    <div>
      <Header
        color="transparent"
        routes={dashboardRoutes}
        // rightLinks={<HeaderLinks />}
        fixed
        changeColorOnScroll={{
          height: 90,
          color: "grey",
        }}
        {...rest}
      />
      <Parallax filter image={require("assets/img/US-Map.jpg")}>
        <div className={classes.container}>
        <Card
              style={{
               background:'#b7b7a4'
              }}
            >
              <CardBody>
                <h2>POWERBALL</h2>
                <h3>Winning Numbers for today:</h3>
                <h4>Current EST Jackpot: </h4>
                <div style={{
                  display: 'flex',
                  flexDirection: 'row',
                  justifyContent: 'center',
                }}>
                  {poolsdata &&
                    poolsdata[0].field_winning_numbers.split(',').map((y, index) => (
                      <div class="numbers-ball" style={{
                        backgroundColor: '#3d405b',
                        width: '35px',
                        height: '35px',
                        borderRadius: '20px',
                        textAlign: 'center',
                        alignItems: 'center',
                        display: 'flex',
                        margin: '10px 8px 10px 0',
                        justifyContent: 'center',
                        fontSize: '19px',
                        fontFamily: 'ProximaNova-Bold',
                        color: 'black',
                      }}>
                        {y}
                      </div>
                    ))}


                </div>
                <div>
                  <GridContainer>
                    <GridItem style={{ color: "black" }} xs={6}>
                      Cash Value : $157,900,000
                    </GridItem>
                    <GridItem style={{ color: "black" }} xs={6}>
                      Next Draw : Tomorrow
                    </GridItem>
                  </GridContainer>
                </div>
                <Button
                  href="#top"
                  // onClick={powerRoute}
                  style={{ background: "#3d405b",color:'black' }}
                  startIcon={<Icon>send</Icon>}
                >
                  Previous Winning Numbers
                </Button>
              </CardBody>
            </Card>
        </div>
      </Parallax>
      <Card style={{width:'250px',display:'contents'}}>

      </Card>
      <Footer />
    </div>
  );
}
